import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import memberService from "../../service/memberService";
import "./Employee.css";

const Profile = () => {
  // let navigate = useNavigate();

  // const [memberName, setMemberName] = useState("");
  // const [dob, setDob] = useState("");
  // const [city, setCity] = useState("");
  // const [state, setState] = useState("");
  // const [emailId, setEmailId] = useState("");
  // const [contactNo, setContactNo] = useState("");
  // const [username, setUsername] = useState("");
  // const [password, setPassword] = useState("");
  // const [planId, setPlanId] = useState("");
  // const [insuredAmount, setInsuredAmount] = useState("");

  // const saveMember = async (e) => {
  //   e.preventDefault();

  //   const obj = {
  //     memberName,
  //     dob,
  //     city,
  //     state,
  //     emailId,
  //     contactNo,
  //     username,
  //     password,
  //     plan: {
  //       planId,
  //       insuredAmount,
  //     },
  //   };

  //   memberService.saveMember(obj).then((res) => {
  //     document.getElementById("Status").innerHTML = "Member Added Successfully";
  //   });

  //   navigate("/members");
  // };

  return (
    <div className="container">
      <h4>Profile Page </h4>
      <hr className="bg-success border-2 border-top border-success" />

      <form className="row g-3 p-4 mt-4">
        <div className="row d-flex justify-content-center">
          <div className="col-md-3 mb-3">
            <label for="name" className="form-label">
              First Name
            </label>
            <input
              type="text"
              className="form-control"
              id="name"
              name="memberName"

              // value={memberName}
              // onChange={(e) => setMemberName(e.target.value)}
            />
          </div>

          <div className="col-md-3 ">
            <label for="Maritial Status" className="form-label">
              Maritial Status
            </label>
            <input
              type="text"
              className="form-control"
              id="status"
              name="status"

              // value={emailId}
              // onChange={(e) => setEmailId(e.target.value)}
            />
          </div>

          <div className="col-md-3">
            <label for="empid" className="form-label">
              EMP ID
            </label>
            <input
              type="number"
              className="form-control"
              id="empid"
              name="empid"

              // value={contactNo}
              // onChange={(e) => setContactNo(e.target.value)}
            />
          </div>
        </div>

        <div className="row d-flex justify-content-center mb-3">
          <div className="col-md-3">
            <label for="contactno" className="form-label">
              Contact No
            </label>
            <input
              type="number"
              className="form-control"
              id="contactno"
              // name="dob"
              // value={dob}
              // onChange={(e) => setDob(e.target.value)}
            />
          </div>

          <div className="col-md-3">
            <label for="dob" className="form-label">
              DOB
            </label>
            <input
              type="text"
              className="form-control"
              id="dob"
              name="dob"
              // value={username}
              // onChange={(e) => setUsername(e.target.value)}
            />
          </div>

          <div className="col-md-3">
            <label for="emailid" className="form-label">
              Email ID
            </label>
            <input
              type="emailid"
              className="form-control"
              id="emailid"
              name="emailid"
              // value={password}
              // onChange={(e) => setPassword(e.target.value)}
            />
          </div>
        </div>

        <div className="row d-flex justify-content-center mb-3">
          <div className="col-md-4">
            <label for="state" className="form-label">
              Title
            </label>
            <input
              type="text"
              className="form-control"
              id="state"
              name="state"
              value="Associate Sofware Engineer"
              disabled
              // value={state}
              // onChange={(e) => setState(e.target.value)}
            />
          </div>

          <div className="col-md-4">
            <label for="gender" className="form-label">
              Gender
            </label>
            <input
            
              type="text"
              className="form-control"
              id="gender"
              name="gender"
            
              ></input>
            
          </div>

          {/* <button

            //  className="btn btn-light dropdown-toggle"
             className="col-md-4"

            //  data-bs-toggle="dropdown"

            >

             Gender

          </button>

           <ul className="dropdown-menu dropdown-menu-light">

         <li>

                <a href="profile" className="dropdown-item">

                 Profile

                </a>
          </li>
          </ul> */}

          <div className="col-md-4">
            <label for="state" className="form-label">
              Address
            </label>
            <input
              type="text"
              className="form-control"
              id="state"
              name="state"
              // value={state}
              // onChange={(e) => setState(e.target.value)}
            />
          </div>
        </div>

        <div className="col-12 text-center mt-5">
          <button type="submit" className="btn btn-success btn-lg shadow px-4">
            Edit
          </button>
          <h> </h>
          <button type="submit" className="btn btn-success btn-lg shadow px-2">
            Submit
          </button>
        </div>
      </form>
    </div>
  );
};

export default Profile;
